(9, 0, '{\"vi\":\"Ben Thanh Market\",\"en\":\"Ben Thanh Market\",\"ja\":\"Ben Thanh Market\",\"cn\":\"Ben Thanh Market\"}', 'ben-thanh-market', '{\"vi\":\"<p>Ch\\u1ee3 B\\u1ebfn Th&agrave;nh: l&agrave; ng&ocirc;i ch\\u1ee3 l\\u1edbn nh\\u1ea5t \\u1edf trung t&acirc;m Saigon n\\u01a1i m&agrave; Qu&yacute; kh&aacute;ch c&oacute; th\\u1ec3 t&igrave;m b\\u1ea5t k\\u1ef3 th\\u1ee9 g&igrave; t\\u1eeb h&agrave;ng h&oacute;a \\u0111\\u01a1n gi\\u1ea3n \\u0111\\u1ebfn nh\\u1eefng m&oacute;n qu&agrave; l\\u01b0u ni\\u1ec7m \\u0111a \\u0111\\u1ea1ng, ch\\u1ea5t l\\u01b0\\u1ee3ng cao.<\\/p>\\r\\n\",\"en\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\",\"ja\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\",\"cn\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-45-20214975523-thumbnail2-jpg.jpg', 'destination', 1, 4, 0, '2016-03-30 21:31:26', '2018-07-10 17:12:33', 1, '10_min', ''),
(11, 0, '{\"vi\":\"Ga S\\u00e0iG\\u00f2n\",\"en\":\"Saigon Railway Station\",\"ja\":\"Saigon Railway Station\",\"cn\":\"Saigon Railway Station\"}', 'saigon-railway-station', '{\"vi\":\"<p>Ga S&agrave;iG&ograve;n: ch\\u1ec9 m\\u1ea5t kho\\u1ea3ng 03 km l&agrave; Qu&yacute; kh&aacute;ch \\u0111&atilde; t\\u1edbi \\u0111\\u01b0\\u1ee3c n\\u01a1i n&agrave;y \\u0111\\u1ec3 b\\u1eaft \\u0111\\u1ea7u nh\\u1eefng chuy\\u1ebfn h&agrave;nh tr&igrave;nh th&uacute; v\\u1ecb \\u0111i \\u0111\\u1ebfn c&aacute;c t\\u1ec9nh th&agrave;nh kh\\u1eafp Vi\\u1ec7t Nam<\\/p>\\r\\n\",\"en\":\"<p>Saigon Railway Station: within an easy access of 03 km you will already get here to experience the exciting adventure of going to different provinces throughout Vietnam<\\/p>\\r\\n\",\"ja\":\"<p>Saigon Railway Station: within an easy access of 03 km you will already get here to experience the exciting adventure of going to different provinces throughout Vietnam<\\/p>\\r\\n\",\"cn\":\"<p>Saigon Railway Station: within an easy access of 03 km you will already get here to experience the exciting adventure of going to different provinces throughout Vietnam<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-45-46919213829-thumbnail2-jpg.jpg', 'destination', 1, 6, 0, '2016-03-30 21:32:53', '2018-07-10 17:13:20', 1, '10_min', ''),
(15, 0, '{\"en\":\"Smart Jacuzzi Pool\",\"vi\":\"H\\u1ed3 Jacuzzi Th\\u00f4ng Minh\",\"ja\":\"Jacuzzi Smart Pool\",\"cn\":\"Jacuzzi Smart Pool\"}', 'smart-jacuzzi-pool', '{\"en\":\"<p>Soak up the atmosphere and the lush surroundings in our gorgeous Smart Jacuzzi Pool, exclusively for our hotel guests only. The best place to cool down and relax after a long day spent outside<\\/p>\\r\\n\\r\\n<p><strong>Location:<\\/strong>&nbsp;M&nbsp;FL&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Open hours:<\\/strong> 06:00 to 20:00<\\/p>\\r\\n\",\"vi\":\"<p>\\u0110\\u1eafm m&igrave;nh trong l&agrave;n n\\u01b0\\u1edbc m&aacute;t l\\u1ea1nh c&ugrave;ng h\\u1ec7 th\\u1ed1ng m&aacute;t xa n\\u01b0\\u1edbc t\\u1ea1i H\\u1ed3 th&ocirc;ng minh c\\u1ee7a kh&aacute;ch s\\u1ea1n, N\\u01a1i d&agrave;nh ri&ecirc;ng cho kh&aacute;ch l\\u01b0u tr&uacute; t\\u1ea1i kh&aacute;ch s\\u1ea1n sau m\\u1ed9t ng&agrave;y d&agrave;i kh&aacute;m ph&aacute; th&agrave;nh ph\\u1ed1.<\\/p>\\r\\n\\r\\n<p>V\\u1ecb tr&iacute; : T\\u1ea7ng 1<\\/p>\\r\\n\\r\\n<p>Th\\u1eddi gian ph\\u1ee5c v\\u1ee5 : 06:00 &ndash; 20:30<\\/p>\\r\\n\",\"ja\":\"<p>\\u30b9\\u30de\\u30fc\\u30c8\\u306a\\u30b8\\u30e3\\u30b0\\u30b8\\u30fc\\u30d7\\u30fc\\u30eb<\\/p>\\r\\n\\r\\n<p>\\u30db\\u30c6\\u30eb\\u30b2\\u30b9\\u30c8\\u306b\\u5c02\\u7528\\u306e\\u8c6a\\u83ef\\u3067\\u30b9\\u30de\\u30fc\\u30c8\\u306a\\u30b8\\u30e3\\u30b0\\u30b8\\u30fc\\u30d7\\u30fc\\u30eb\\u3067\\u306e\\u96f0\\u56f2\\u6c17\\u3068\\u8c4a\\u5bcc\\u306a\\u74b0\\u5883\\u306b\\u6d78\\u3063\\u3066\\u304f\\u3060\\u3055\\u3044\\u3002\\u5916\\u3067\\u904e\\u3054\\u3057\\u305f\\u9577\\u3044\\u4e00\\u65e5\\u306e\\u5f8c\\u306b\\u4f53\\u3092\\u51b7\\u3057\\u3066\\u30ea\\u30e9\\u30c3\\u30af\\u30b9\\u3059\\u308b\\u305f\\u3081\\u306b\\u6700\\u826f\\u306e\\u5834\\u6240\\u3067\\u3059\\u3002<\\/p>\\r\\n\",\"cn\":\"<p>\\u667a\\u80fd\\u5316\\u7684\\u6309\\u6469\\u6d74\\u6c60<\\/p>\\r\\n\\r\\n<p>\\u6211\\u4eec\\u534e\\u4e3d\\u7684\\u6309\\u6469\\u6d74\\u6c60\\u4ec5\\u5bf9\\u9152\\u5e97\\u6d88\\u8d39