(26, 0, '{\"vi\":\"Nh\\u00e0 h\\u00e0ng\",\"en\":\"Restaurant\"}', 'restaurant', '{\"vi\":\"<p>Ph\\u1ee5c v\\u1ee5 \\u1ea9m th\\u1ef1c v\\u1edbi c&aacute;c m&oacute;n \\u0103n \\u0111\\u1eb7c s\\u1eafc mang &acirc;m h\\u01b0\\u1edfng Vi\\u1ec7t Nam v&agrave; &Acirc;u - &Aacute;.<\\/p>\\r\\n\",\"en\":\"<p>Where daily dining can be provided with delightful dishes carrying Vietnamese and Asian-Western characteristics.<\\/p>\\r\\n\"}', '{\"vi\":\"<p>Ph\\u1ee5c v\\u1ee5 \\u1ea9m th\\u1ef1c v\\u1edbi c&aacute;c m&oacute;n \\u0103n \\u0111\\u1eb7c s\\u1eafc mang &acirc;m h\\u01b0\\u1edfng Vi\\u1ec7t Nam v&agrave; &Acirc;u - &Aacute;.<\\/p>\\r\\n\\r\\n<p>Buffet s&aacute;ng \\u0111\\u01b0\\u1ee3c m\\u1edf c\\u1eeda t\\u1eeb 6h00 \\u0111\\u1ebfn 9h00, v\\u1edbi nhi\\u1ec1u m&oacute;n gi&agrave;u dinh d\\u01b0\\u1ee1ng cung c\\u1ea5p n\\u0103ng l\\u01b0\\u1ee3ng cao \\u0111\\u1ec3 b\\u1eaft \\u0111\\u1ea7u ng&agrave;y m\\u1edbi th\\u1eadt s\\u1ea3ng kho&aacute;i.<\\/p>\\r\\n\\r\\n<p>Bu\\u1ed5i tr\\u01b0a \\u0111\\u01b0\\u1ee3c ph\\u1ee5c v\\u1ee5 t\\u1eeb 11h00 \\u0111\\u1ebfn 14h00 v&agrave; bu\\u1ed5i t\\u1ed1i t\\u1eeb 18hh00 \\u0111\\u1ebfn 22h00. C&aacute;c m&oacute;n \\u0103n x\\u1ebf c&oacute; th\\u1ec3 \\u0111\\u01b0\\u1ee3c g\\u1ecdi v&agrave; ph\\u1ee5c v\\u1ee5 trong kho\\u1ea3ng 14h30 \\u0111\\u1ebfn 18h00<\\/p>\\r\\n\",\"en\":\"<p>Where daily dining can be provided with delightful dishes carrying Vietnamese and Asian-Western characteristics.<\\/p>\\r\\n\\r\\n<p>The buffet breakfast is opened from 06h00 to 09h00 daily, with a great variety of items provides you with full nutrition for a good start of the day.<\\/p>\\r\\n\\r\\n<p>While lunch is served from 11h00-14h00 and dinner from 18h00-22h00, snacks can be ordered any time between 14h30-18h00.<\\/p>\\r\\n\"}', '2018-07-10-15-11-37528166606-thumbnail2-jpg.jpg', 'services', 1, 3, 0, '2018-06-27 14:30:18', '2018-10-23 15:59:23', 1, '', '2018-07-10-15-11-37544059260-ic-restaurant-png.png'),
(27, 0, '{\"vi\":\"Ph\\u1ee5c v\\u1ee5 \\u1ea9m th\\u1ef1c t\\u1ea1i ph\\u00f2ng\",\"en\":\"Room service\",\"ja\":\"Room service\",\"cn\":\"Room service\"}', 'room-service', '{\"vi\":\"<p>Qu&yacute; v\\u1ecb kh&ocirc;ng th&iacute;ch xu\\u1ed1ng nh&agrave; h&agrave;ng? \\u0110\\u1eebng lo v&igrave; \\u0111&atilde; c&oacute; d\\u1ecbch v\\u1ee5 ph\\u1ee5c v\\u1ee5 \\u1ea9m th\\u1ef1c t\\u1eadn ph&ograve;ng v\\u1edbi th\\u1ef1c \\u0111\\u01a1n \\u0111a d\\u1ea1ng c&aacute;c m&oacute;n \\u0103n kho&aacute;i kh\\u1ea9u<\\/p>\\r\\n\",\"en\":\"<p>Tired of going down the restaurant? Don&rsquo;t worry! Our room service menu is created just for your in-room dining with an array of delights.<\\/p>\\r\\n\",\"ja\":\"<p>Tired of going down the restaurant? Don&rsquo;t worry! Our room service menu is created just for your in-room dining with an array of delights.<\\/p>\\r\\n\",\"cn\":\"<p>Tired of going down the restaurant? Don&rsquo;t worry! Our room service menu is created just for your in-room dining with an array of delights.<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-11-41-17483318338-thumbnail2-jpg.jpg', 'services', 1, 4, 0, '2018-06-27 14:31:33', '2018-07-10 15:11:51', 1, '', '2018-07-10-15-11-51976595228-ic-service-png.png'),
(28, 0, '{\"vi\":\"Ph\\u00f2ng h\\u1ecdp & h\\u1ed9i ngh\\u1ecb\",\"en\":\"Meeting & conference rooms\"}', 'meeting--conference-rooms', '{\"vi\":\"<p>\\u0110\\u1ea1i s\\u1ea3nh v&agrave; c&aacute;c ph&ograve;ng h\\u1ecdp ri&ecirc;ng bi\\u1ec7t v\\u1edbi c&aacute;c trang thi\\u1ebft b\\u1ecb hi\\u1ec7n \\u0111\\u1ea1i c&oacute; th\\u1ec3 \\u0111&aacute;p \\u1ee9ng nhu c\\u1ea7u h\\u1ed9i h\\u1ecdp c\\u1ee7a Qu&yacute; v\\u1ecb \\u0111\\u1ed1i v\\u1edbi nh&oacute;m nh\\u1ecf c\\u1ee1 10 kh&aacute;ch ho\\u1eb7c s\\u1ef1 ki\\u1ec7n l\\u1edbn l&ecirc;n \\u0111\\u1ebfn ...&nbsp;kh&aacute;ch<\\/p>\\r\\n\",\"en\":\"<p>Our spacious Ballrooms and break-out rooms with state-of-the-art equipment can meet your function demands for a small group of 10 persons or a big event up to ... persons.<\\/p>\\r\\n\"}', '{\"vi\":\"<p>\\u0110\\u1ea1i s\\u1ea3nh v&agrave; c&aacute;c ph&ograve;ng h\\u1ecdp ri&ecirc;ng bi\\u1ec7t v\\u1edbi c&aacute;c trang thi\\u1ebft b\\u1ecb hi\\u1ec7n \\u0111\\u1ea1i c&oacute; th\\u1ec3 \\u0111&aacute;p \\u1ee9ng nhu c\\u1ea7u h\\u1ed9i h\\u1ecdp c\\u1ee7a Qu&yacute; v\\u1ecb \\u0111\\u1ed1i v\\u1edbi nh&oacute;m nh\\u1ecf c\\u1ee1 10 kh&aacute;ch ho\\u1eb7c s\\u1ef1 ki\\u1ec7n l\\u1edbn l&ecirc;n \\u0111\\u1ebfn ... kh&aacute;ch<\\/p>\\r\\n\\r\\n<p>Ch&uacute;ng t&ocirc;i c&oacute; th\\u1ec3 s\\u1eafp x\\u1ebfp c&aacute;c ki\\u1ec3u \\u0111a d\\u1ea1ng nh\\u01b0 ki\\u1ec3u s&acirc;n kh\\u1ea5u, l\\u1edbp h\\u1ecdc, b&agrave;n tr&ograve;n, h&igrave;nh ch\\u1eef U ho\\u1eb7c t\\u01b0\\u01a1ng t\\u1ef1<\\/p>\\r\\n\\r\\n<p>C&aacute;c thi\\u1ebft b\\u1ecb \\u0111i k&egrave;m ho\\u1eb7c thi\\u1ebft b\\u1ecb b\\u1ed5 sung lu&ocirc;n s\\u1eb5n s&agrave;ng theo y&ecirc;u c\\u1ea7u bao g\\u1ed3m b\\u1ea3ng gi\\u1ea5y, l\\u1eafp gh&eacute;p s&acirc;n kh\\u1ea5u, micro, b\\u1ee5c ph&aacute;t bi\\u1ec3u, bi\\u1ec3u ng\\u1eef, c&aacute;c thi\\u1ebft b\\u1ecb nghe nh&igrave;n&hellip;..<\\/p>\\r\\n\\r\\n<p>C&aacute;c g&oacute;i d\\u1ecbch v\\u1ee5 trong danh m\\u1ee5c c&oacute; th\\u1ec3 k\\u1ec3 \\u0111\\u1ebfn l&agrave; thu&ecirc; ph&ograve;ng h\\u1ed9i ngh\\u1ecb, tr\\u1ecdn g&oacute;i h\\u1ecdp-\\u0103n tr\\u01b0a ho\\u1eb7c \\u0103n t\\u1ed1i v&agrave; c&oacute; th\\u1ec3 l&agrave; c&aacute;c bu\\u1ed5i ti\\u1ec7c m\\u1eebng th&ocirc;i n&ocirc;i, sinh nh\\u1eadt ho\\u1eb7c ti\\u1ec7c c\\u01b0\\u1edbi.<\\/p>\\r\\n\\r\\n<p>Th\\u1ef1c \\u0111\\u01a1n cho c&aacute;c s\\u1ef1 ki\\u1ec7n ti\\u1ec7c \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf \\u0111\\u1eb7c bi\\u1ec7t b\\u1edfi B\\u1ebfp Tr\\u01b0\\u1edfng t&agrave;i n\\u0103ng c\\u1ee7a ch&uacute;ng t&ocirc;i ch&iacute;nh l&agrave; s\\u1ef1 s&aacute;ng t\\u1ea1o tuy\\u1ec7t v\\u1eddi nh\\u1ea5t nh\\u1eb1m \\u0111&aacute;p \\u1ee9ng kh\\u1ea9u v\\u1ecb tinh t\\u1ebf c\\u1ee7a Qu&yacute; v\\u1ecb<\\/p>\\r\\n\",\"en\":\"<p>Our spacious Ballrooms and break-out rooms with state-of-the-art equipment can meet your function demands for a small group of 10 persons or a big event up to ... persons.<\\/p>\\r\\n\\r\\n<p>Different set-up styles can be offered such as theater, classroom, roundtable, U-shape and so on.<\\/p>\\r\\n\\r\\n<p>Inclusive or add-on equipment also available per extra request ranges from flipcharts, stage, microphones, podium, backdrop\\/banner, audio-visuals&hellip;<\\/p>\\r\\n\\r\\n<p>Service offered can be from a room rental, a half-day or full-day package or even birthday\\/wedding parties.<\\/p>\\r\\n\\r\\n<p>The menus for banquet\\/catering specially designed by our talented Executive Chef are those of fabulous creations to delight your taste buds<\\/p>\\r\\n\\r\\n<p>Parking Lot is reserved on an area of 1.500 square meters. With a capacity of 30 vehicles ( from 4 to 45 seats) &amp; 100 motorbikes, it can conveniently offer enough space to safe keep your vehicles<\\/p>\\r\\n\"}', '2018-07-10-11-41-26571944729-thumbnail2-jpg.jpg', 'services', 1, 5, 1, '2018-06-27 14:32:42', '2018-11-01 18:43:09', 1, '', '2018-07-10-15-12-06833599980-ic-meet-png.png'),
(29, 0, '{\"vi\":\"B\\u00e3i Gi\\u1eef xe\",\"en\":\"Car park\"}', 'car-park', '{\"vi\":\"<p>B&atilde;i gi\\u1eef xe \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng tr&ecirc;n khu&ocirc;n vi&ecirc;n 1.500 m<sup>2<\\/sup>.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\",\"en\":\"<p><span style=\\\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px\\\">The parking lot is built on an area of \\u200b\\u200b1,500 m<sup>2<\\/sup><\\/span><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\"}', '{\"vi\":\"<p>B&atilde;i gi\\u1eef xe \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng tr&ecirc;n khu&ocirc;n vi&ecirc;n 1.500 m<sup>2<\\/sup>. V\\u1edbi kh\\u1ea3 n\\u0103ng gi\\u1eef \\u0111\\u01b0\\u1ee3c 30 xe h\\u01a1i ( c&aacute;c lo\\u1ea1i t\\u1eeb 4-45 ch\\u1ed7) v&agrave; 100 xe g\\u1eafn m&aacute;y, b&atilde;i xe c&oacute; th\\u1ec3 b\\u1ea3o \\u0111\\u1ea3m an to&agrave;n l\\u01b0u th&ocirc;ng cho ph\\u01b0\\u01a1ng ti\\u1ec7n c\\u1ee7a Qu&yacute; kh&aacute;ch m\\u1ed9t c&aacute;ch tr\\u1ecdn v\\u1eb9n nh\\u1ea5t.<\\/p>\\r\\n\",\"en\":\"<p><span style=\\\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px\\\">The parking lot is built on an area of \\u200b\\u200b1,500 m<sup>2<\\/sup>. With the ability to keep 30 cars (types from 4 to 45 seats) and 100 motorcycles, the car park can ensure traffic circulation for your vehicle in the fullest.<\\/span><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\"}', '2018-10-25-21-13-44670186668-bai-giu-xe-jpg.jpg', 'services', 1, 6, 0, '2018-10-25 21:13:44', '2018-11-01 18:52:49', 1, '', '');
