(2, 'Ambassador Vung Tau Hotel', 'ambassador-vung-tau-hotel', 2, 4, 'info@ambassadorhotelgroup.com', 'sales@ambassadorhotelgroup.com', '0901.222.291', '02838 634 847', '+84862907079', 80, '{\"vi\":\"7-8 T\\u1ea1 Uy\\u00ean, ph\\u01b0\\u1eddng 3\",\"en\":\"7-8 Ta Uyen , Ward 3\"}', '{\"vi\":\"Th\\u00e0nh ph\\u1ed1 V\\u0169ng T\\u00e0u\",\"en\":\"Vung Tau city\"}', '{\"vi\":\"Vietnam\",\"en\":\"Vietnam\"}', '{\"vi\":\"Kh\\u00e1ch s\\u1ea1n <font>Ambassador<\\/font> V\\u0169ng T\\u00e0u\",\"en\":\"<font>Ambassador<\\/font> Vung Tau Hotel\"}', '{\"vi\":null,\"en\":null}', '{\"vi\":\"<p>T\\u1ecda l\\u1ea1c y&ecirc;n b&igrave;nh sau tr\\u1ee5c \\u0111\\u01b0\\u1eddng 3 th&aacute;ng 2 s\\u1ea7m u\\u1ea5t, Kh&aacute;ch s\\u1ea1n Pandora \\u0111\\u01b0\\u1ee3c n&acirc;ng c\\u1ea5p to&agrave;n di\\u1ec7n v&agrave;o n\\u0103m 2018 n\\u1eb1m trong khu&ocirc;n vi&ecirc;n r\\u1ed9ng r&atilde;i c\\u1ee7a H\\u1ecdc Vi\\u1ec7n H&agrave;nh Ch&iacute;nh Qu\\u1ed1c Gia. Kh&aacute;ch s\\u1ea1n bao g\\u1ed3m 103 ph&ograve;ng v\\u1edbi phong c&aacute;ch thi\\u1ebft k\\u1ebf v\\u1eeba c\\u1ed5 \\u0111i\\u1ec3n v\\u1eeba hi\\u1ec7n \\u0111\\u1ea1i t\\u1ea1o n&ecirc;n m\\u1ed9t di\\u1ec7n m\\u1ea1o ki\\u1ebfn tr&uacute;c h&agrave;i h&ograve;a. \\u0110&acirc;y \\u0111\\u01b0\\u1ee3c xem l&agrave; l\\u1ef1a ch\\u1ecdn th&iacute;ch h\\u1ee3p \\u0111\\u1ec3 \\u0111&oacute;n ti\\u1ebfp kh&aacute;ch \\u0111\\u1ebfn l\\u01b0u tr&uacute; ngh\\u1ec9 ng\\u01a1i hay \\u0111i c&ocirc;ng t&aacute;c v&agrave; c\\u0169ng l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m th\\u01b0 gi&atilde;n nh\\u1eb9 nh&agrave;ng sau nh\\u1eefng gi\\u1edd l&agrave;m vi\\u1ec7c m\\u1ec7t nh\\u1ecdc.<\\/p>\\r\\n\\r\\n<p>V\\u1edbi \\u0111\\u1ed9i ng\\u0169 nh&acirc;n vi&ecirc;n chuy&ecirc;n nghi\\u1ec7p, ch&uacute;ng t&ocirc;i lu&ocirc;n mang \\u0111\\u1ebfn cho Qu&yacute; kh&aacute;ch m\\u1ed9t d\\u1ecbch v\\u1ee5 t\\u1ed1t nh\\u1ea5t v\\u1edbi s\\u1ef1 th&acirc;n thi\\u1ec7n, c\\u1edfi m\\u1edf v&agrave; hi\\u1ebfu kh&aacute;ch.<\\/p>\\r\\n\\r\\n<p>D&ugrave; Qu&yacute; v\\u1ecb \\u0111ang \\u0111i c&ocirc;ng t&aacute;c hay ngh\\u1ec9 d\\u01b0\\u1ee1ng th&igrave; ch&uacute;ng t&ocirc;i v\\u1eabn tin ch\\u1eafc r\\u1eb1ng \\u0111&acirc;y s\\u1ebd l&agrave; l\\u1ef1a ch\\u1ecdn \\u01b0u ti&ecirc;n c\\u1ee7a Q&uacute;y v\\u1ecb.<\\/p>\\r\\n\\r\\n<div>K&iacute;nh ch&uacute;c Qu&yacute; kh&aacute;ch m\\u1ed9t k&igrave; ngh\\u1ec9 th\\u1eadt th&uacute; v\\u1ecb!<\\/div>\\r\\n\",\"en\":\"<p>Peacefully located behind the bustling Ba Thang Hai street with many busy business activities, Pandora Hotel &amp; Residences, spaciously and completely renovated in 2018 within the premise of National Academy of Public Administration, boasts 103 nicely-furnished rooms in both traditional and modern designs which create a new look with a harmonious combination of architectures where guests can fill with high energetic feelings on business while also relax at ease when needed after work.<\\/p>\\r\\n\\r\\n<div>The friendly service offered by its well-trained staffs was inspired by high dedication, passion and commitment on best quality giving all guests greatest comfort and enjoyment.\\r\\n<p>When you are here no matter on business or leisure we can assure this is certainly your home away from home.<\\/p>\\r\\nStay comfortably!<\\/div>\\r\\n\"}', '{\"vi\":\"<p>Kh&aacute;ch s\\u1ea1n Ambassador V\\u0169ng T&agrave;u \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf, trang tr&iacute; \\u0111\\u1ed9c \\u0111&aacute;o, \\u1ea5m c&uacute;ng theo phong c&aacute;ch ch&acirc;u &Acirc;u ti&ecirc;u chu\\u1ea9n 3 sao, n\\u1eb1m ngay v\\u1ecb tr&iacute; trung t&acirc;m thu\\u1eadn ti\\u1ec7n cho vi&ecirc;\\u0323c kinh doanh - vui ch\\u01a1i- tham quan v&agrave; mua s\\u1eafm.<\\/p>\\r\\n\",\"en\":\"<p>Ambassador Hotel Vung Tau is designed, decorated nicely, warm European-style 3-star standard, located in the center for business - pleasure - sightseeing and shopping.<\\/p>\\r\\n\"}', '2016-03-29 21:54:52', '2018-11-15 23:06:47', 1, 