(44, '{\"en\":\"<h2 class=\\\"tleContent\\\">Tell us a little about your event, then we\\u2019ll contact you and plan it together!!<\\/h2>\\r\\n<ul class=\\\"lsttxtevents\\\">\\r\\n<li>Our hotel inspires successful meetings, with modern facilities and a convenient Ho Chi Minh City location<\\/li>\\r\\n<li>We proudly offer 3 meeting rooms for rental across 600 m2 flexible event space.\\r\\n<\\/li><li>Each meeting room space features high-speed Internet access and a range of audio visual equipment.\\r\\n<\\/li><li>Accentuate your event with a creative and delicious menu, provided by our talented culinary team.\\r\\n<\\/li><li>Our on-site planning staff will help you with every detail - from meeting room set-ups to catering.\\r\\n<\\/li><li>Our central location with easy access to public transport makes the hotel the place to meet.<\\/li><\\/ul>\",\"vi\":\"<h2 class=\\\"tleContent\\\">H\\u00e3y cho ch\\u00fang t\\u00f4i m\\u1ed9t ch\\u00fat th\\u00f4ng tin v\\u1ec1 s\\u1ef1 ki\\u1ec7n c\\u1ee7a Q\\u00fay kh\\u00e1ch. Ch\\u00fang t\\u00f4i s\\u1ebd li\\u00ean h\\u1ec7 v\\u1edbi Q\\u00fay kh\\u00e1ch v\\u00e0 l\\u00ean k\\u1ebf ho\\u1ea1ch c\\u00f9ng nhau !!<\\/h2>\\r\\n<ul class=\\\"lsttxtevents\\\"><li>Kh\\u00e1ch s\\u1ea1n ch\\u00fang t\\u00f4i truy\\u1ec1n c\\u1ea3m h\\u1ee9ng cho nh\\u1eefng cu\\u1ed9c h\\u1ecdp th\\u00e0nh c\\u00f4ng, v\\u1edbi ti\\u1ec7n nghi hi\\u1ec7n \\u0111\\u1ea1i v\\u00e0 m\\u1ed9t v\\u1ecb tr\\u00ed thu\\u1eadn ti\\u1ec7n t\\u1ea1i Th\\u00e0nh ph\\u1ed1 H\\u1ed3 Ch\\u00ed Minh.\\r\\n<\\/li><li>Ch\\u00fang t\\u00f4i t\\u1ef1 h\\u00e0o cung c\\u1ea5p 3 ph\\u00f2ng h\\u1ecdp v\\u1edbi di\\u1ec7n t\\u00edch tr\\u00ean 500 m2 kh\\u00f4ng gian s\\u1ef1 ki\\u1ec7n linh ho\\u1ea1t.\\r\\n<\\/li><li>M\\u1ed7i kh\\u00f4ng gian ph\\u00f2ng h\\u1ecdp c\\u00f3 truy c\\u1eadp Internet t\\u1ed1c \\u0111\\u1ed9 cao v\\u00e0 c\\u00e1c thi\\u1ebft b\\u1ecb nghe nh\\u00ecn hi\\u1ec7n \\u0111\\u1ea1i.\\r\\n<\\/li><li>Nh\\u1eefng th\\u1ef1c \\u0111\\u01a1n s\\u00e1ng t\\u1ea1o v\\u00e0 h\\u1ee3p kh\\u1ea9u v\\u1ecb, \\u0111\\u01b0\\u1ee3c cung c\\u1ea5p b\\u1edfi \\u0111\\u1ed9i \\u1ea9m th\\u1ef1c t\\u00e0i n\\u0103ng c\\u1ee7a kh\\u00e1ch s\\u1ea1n.\\r\\n<\\/li><li>Nh\\u00e2n vi\\u00ean t\\u01b0 v\\u1ea5n c\\u1ee7a ch\\u00fang t\\u00f4i s\\u1ebd gi\\u00fap Q\\u00fay kh\\u00e1ch t\\u1ea5t c\\u1ea3 c\\u00e1c chi ti\\u1ebft t\\u1eeb nh\\u1ecf nh\\u1ea5t.\\r\\n<\\/li><li>V\\u1ecb tr\\u00ed trung t\\u00e2m c\\u1ee7a c\\u1ee7a Kh\\u00e1ch s\\u1ea1n gi\\u00fap Q\\u00fay kh\\u00e1ch d\\u1ec5 d\\u00e0ng ti\\u1ebfp c\\u1eadn v\\u00e0 thu\\u1eadn ti\\u1ec7n trong vi\\u1ec7c di chuy\\u1ec3n.<\\/li><\\/ul>\",\"ja\":\"\\u4f1a\\u8b70\\u3068\\u30a4\\u30d9\\u30f3\\u30c8\\r\\n \\u3042\\u306a\\u305f\\u306e\\u30a4\\u30d9\\u30f3\\u30c8\\u306b\\u3064\\u3044\\u3066\\u3001\\u5c11\\u3057\\u3067\\u3082\\u79c1\\u305f\\u3061\\u306b\\u304a\\u77e5\\u3089\\u305b\\u304f\\u3060\\u3055\\u3044\\u3002\\u305d\\u308c\\u304b\\u3089\\u3001\\u3054\\u9023\\u7d61\\u3092\\u5dee\\u3057\\u4e0a\\u3052\\u3066\\u3001\\u3054\\u4e00\\u7dd2\\u306b\\u8a08\\u753b\\u3057\\u307e\\u3059!!\\r\\n\\u2022\\t\\u30db\\u30c6\\u30eb\\u306f\\u3001\\u30e2\\u30c0\\u30f3\\u306a\\u65bd\\u8a2d\\u3068\\u30db\\u30fc\\u30c1\\u30df\\u30f3\\u5e02\\u306e\\u4fbf\\u5229\\u306a\\u4f4d\\u7f6e\\u306b\\u3088\\u3063\\u3066\\u3001\\u4f1a\\u8b70\\u306e\\u6210\\u529f\\u3092\\u62db\\u3044\\u3066\\u3044\\u307e\\u3059\\u3002\\r\\n\\u2022\\t\\u79c1\\u305f\\u3061\\u306f\\u3001\\u9806\\u5fdc\\u6027\\u306e\\u3042\\u308b600m2\\u306e\\u30a4\\u30d9\\u30f3\\u30c8\\u30b9\\u30da\\u30fc\\u30b9\\u306b\\u308f\\u305f\\u3063\\u3066\\u3001\\u30ec\\u30f3\\u30bf\\u30eb\\u5411\\u3051\\u306e3\\u5ba4\\u306e\\u4f1a\\u8b70\\u5ba4\\u3092\\u8a87\\u308a\\u3092\\u3082\\u3063\\u3066\\u6e96\\u5099\\u3057\\u3066\\u3044\\u307e\\u3059\\u3002\\r\\n\\u2022\\t\\u305d\\u308c\\u305e\\u308c\\u306e\\u4f1a\\u8b70\\u5ba4\\u30b9\\u30da\\u30fc\\u30b9\\u306f\\u3001\\u9ad8\\u901f\\u30a4\\u30f3\\u30bf\\u30fc\\u30cd\\u30c3\\u30c8\\u30fb\\u30a2\\u30af\\u30