(45, '{\"en\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\",\"vi\":\"T\\u1ea5t c\\u1ea3 ph\\u00f2ng \\u0111\\u01b0\\u1ee3c trang b\\u1ecb \\u0111\\u1ea7y \\u0111\\u1ee7 trang thi\\u1ebft b\\u1ecb v\\u00e0 v\\u1eadt dung cao c\\u1ea5p t\\u1ea1o tr\\u1ea3i nghi\\u1ec7m tho\\u1ea3i m\\u00e1i nh\\u1ea5t cho du kh\\u00e1ch. \\u0110i\\u1ec3m c\\u1ed9ng l\\u00e0 t\\u1ea5t c\\u1ea3 c\\u00e1c ph\\u00f2ng \\u0111\\u1ec1u c\\u00f3 ban-c\\u00f4ng\",\"ja\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\",\"cn\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\"}', 'room_des', 1, 'Room Description', '0000-00-00 00:00:00', '2018-10-23 15:44:43', 1),
(47, '{\"en\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\",\"vi\":\"Kh\\u00e1ch s\\u1ea1n c\\u1ee7a ch\\u00fang t\\u00f4i \\u0111\\u01b0\\u1ee3c trang b\\u1ecb \\u0111\\u1ea7y \\u0111\\u1ee7 v\\u00e0 hi\\u1ec7n \\u0111\\u1ea1i v\\u1edbi d\\u1ecbch v\\u1ee5 \\u0111a d\\u1ea1ng \\u0111\\u00e1p \\u1ee9ng t\\u1ed1t t\\u1eeb nhu c\\u1ea7u c\\u0103n b\\u1ea3n \\u0111\\u1ebfn cao c\\u1ea5p. Nh\\u1eefng b\\u1ed9 ph\\u1eadn sau lu\\u00f4n lu\\u00f4n s\\u1eb5n s\\u00e0ng ph\\u1ee5c v\\u1ee5 Qu\\u00fd kh\\u00e1ch:\",\"ja\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\",\"cn\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\"}', 'facilites', 1, 'Hotel Facilities', '0000-00-00 00:00:00', '2018-10-23 15:57:50', 1),
(46, '{\"en\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\",\"vi\":\"C\\u00e1c k\\u1ef9 thu\\u1eadt vi\\u00ean tr\\u1ecb li\\u1ec7u c\\u1ee7a ch\\u00fang t\\u00f4i v\\u1edbi nhi\\u1ec1u ph\\u01b0\\u01a1ng ph\\u00e1p lu\\u00f4n t\\u1ea1o \\u0111\\u01b0\\u1ee3c c\\u00e1c tr\\u1ea3i nghi\\u1ec7m kh\\u00e1c nhau \\u0111\\u1ec3 l\\u00e0m d\\u1ecbu nh\\u1eefng m\\u1ec7t m\\u1ecfi c\\u0103ng th\\u1eb3ng v\\u00e0  l\\u1ea5y l\\u1ea1i n\\u0103ng l\\u01b0\\u1ee3ng cho Qu\\u00fd v\\u1ecb sau m\\u1ed9t ng\\u00e0y l\\u00e0m vi\\u1ec7c m\\u1ec7t nho\\u00e0i. C\\u00f3 ph\\u00f2ng \\u0111\\u01a1n v\\u00e0 \\u0111\\u00f4i \\u0111\\u1ec3 Qu\\u00fd v\\u1ecb l\\u1ef1a ch\\u1ecdn ph\\u00f9 h\\u1ee3p v\\u1edbi nhu c\\u1ea7u\",\"ja\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\",\"cn\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\"}', 'aspa', 1, 'A Spa Description', '0000-00-00 00:00:00', '2018-07-12 11:41:57', 1),
