(48, '{\"en\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"vi\":\"\\u0110\\u1ec3 \\u0111\\u1eb7t ph\\u00f2ng ho\\u1eb7c c\\u00f3 c\\u00e2u h\\u1ecfi kh\\u00e1c Qu\\u00fd v\\u1ecb c\\u00f3 th\\u1ec3 g\\u1edfi email \\u0111\\u1ebfn <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> ho\\u1eb7c truy c\\u1eadp website <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"ja\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"cn\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\"}', 'contact', 1, 'Contact Us', '0000-00-00 00:00:00', '2018-10-24 08:51:45', 1),
(49, '{\"en\":\"Please contact us to get special offer\",\"vi\":\"H\\u00e3y li\\u00ean l\\u1ea1c v\\u1edbi ch\\u00fang t\\u00f4i \\u0111\\u1ec3 c\\u00f3 gi\\u00e1 t\\u1ed1t nh\\u1ea5t\"}', 'special_offers', 1, 'Special Offers', '0000-00-00 00:00:00', '2018-10-28 22:25:07', 1),
(50, '{\"en\":\"Pandora Hotel is proudly situated in district 10 with easy access to Phu Tho Stadium, Tan Binh Exhibition and Convention Center (TBECC), China Town, Cao Thang Street Food Market and Satra Supermarket. The location is 2.8 away from Ben Thanh Market in downtown Saigon where almost all goods are sold for your shopping demands\",\"vi\":\"Kh\\u00e1ch s\\u1ea1n Pandora t\\u1ecda l\\u1ea1c t\\u1ea1i trung t\\u00e2m qu\\u1eadn 10, n\\u01a1i ti\\u1ebfp c\\u1eadn d\\u1ec5 d\\u00e0ng khu v\\u1ef1c l\\u00e2n c\\u1eadn nh\\u01b0 Nh\\u00e0 h\\u00e1t H\\u00f2a B\\u00ecnh (300 m), Vi\\u1ec7t Nam Qu\\u1ed1c T\\u1ef1 (400 m),  Trung t\\u00e2m ti\\u1ec7c c\\u01b0\\u1edbi Capella ( 800 m), Ga S\\u00e0iG\\u00f2n ( 1.5 km), Nh\\u00e0 Thi \\u0110\\u1ea5u Ph\\u00fa Th\\u1ecd, Trung t\\u00e2m tri\\u1ec3n l\\u00e3m & h\\u1ed9i ngh\\u1ecb T\\u00e2n B\\u00ecnh, Ph\\u1ed1 Ng\\u01b0\\u1eddi Hoa-Ch\\u1ee3 L\\u1edbn, Ch\\u1ee3 \\u0111\\u00eam Cao Th\\u1eafng v\\u00e0 Si\\u00eau th\\u1ecb Satra. V\\u1ecb tr\\u00ed kh\\u00e1ch s\\u1ea1n ch\\u1ec9 c\\u00e1ch ch\\u1ee3 B\\u1ebfn Th\\u00e0nh 2.5 km \\u1edf trung t\\u00e2m S\\u00e0i G\\u00f2n v\\u00e0 l\\u00e0 n\\u01a1i h\\u1ea7u h\\u1ebft c\\u00e1c lo\\u1ea1i h\\u00e0ng h\\u00f3a \\u0111\\u01b0\\u1ee3c b\\u00e0y b\\u00e1n cho nhu c\\u1ea7u mua s\\u1eafm c\\u1ee7a Qu\\u00fd kh\\u00e1ch.\"}', 'destination', 1, 'Destination', '0000-00-00 00:00:00', '2018-10-28 22:39:43', 1),
(53, '\"{\\\"en\\\":\\\"How to get there:<br\\/>\\r\\n<strong>From Tan Son Nhat International <\\/strong><br\\/>Go out to Truong Son Street, continue to Tran Quoc Hoan and turn left to Hoang Van Thu, then go along Nam Ky Khoi Nghia until you reach the intersection with Vo Thi Sau, then turn right and go straight on Vo Thi Sau passing a few intersections until you reach Dan Chu ( Democracy Square) Roundabout, then exit to 3 Thang 2 Street and go straight until you locate the hotel at Section C, #10, 3 thang 2 street, ward 12, District 10, Ho Chi Minh City- National Institute of Administration HCM City\\\",\\\"vi\\\":\\\"H\\u01b0\\u1edbng d\\u1eabn \\u0111\\u01b0\\u1eddng<br\\/><strong>T\\u1eeb s\\u00e2n bay T\\u00e2n S\\u01a1n Nh\\u1ea5t:<\\/strong><br\\/>Ra \\u0111\\u01b0\\u1eddng Tr\\u01b0\\u1eddng S\\u01a1n, \\u0111i ti\\u1ebfp \\u0111\\u1ebfn Tr\\u1ea7n Qu\\u1ed1c Ho\\u00e0n v\\u00e0 qu\\u1eb9o tr\\u00e1i ra Ho\\u00e0ng V\\u0103n Th\\u1ee5, sau \\u0111\\u00f3 \\u0111i d\\u1ecdc Nam K\\u1ef3 Kh\\u1edfi Ngh\\u0129a \\u0111\\u1ebfn khi g\\u1eb7p ng\\u00e3 t\\u01b0 v\\u1edbi V\\u00f5 Th\\u1ecb S\\u00e1u, qu\\u1eb9o ph\\u1ea3i v\\u00e0 \\u0111i th\\u1eb3ng tr\\u00ean V\\u00f5 Th\\u1ecb S\\u00e1u qua v\\u00e0i c\\u00e1i ng\\u00e3 t\\u01b0 \\u0111\\u1ebfn khi g\\u1eb7p v\\u00f2ng xoay C\\u00f4ng Tr\\u01b0\\u1eddng D\\u00e2n Ch\\u1ee7, sau \\u0111\\u00f3 tho\\u00e1t v\\u00f2ng xoay \\u0111\\u1ec3 ra \\u0111\\u01b0\\u1eddng 3 th\\u00e1ng 2 cho \\u0111\\u1ebfn khi t\\u00ecm \\u0111\\u01b0\\u1ee3c Kh\\u00e1ch s\\u1ea1n t\\u1ea1i Khu C, S\\u1ed1 10 \\u0110\\u01b0\\u1eddng 3\\/2, Ph\\u01b0\\u1eddng 12, Qu\\u1eadn 10, Tp.HCM - H\\u1ecdc Vi\\u1ec7n H\\u00e0nh Ch\\u00ednh Qu\\u1ed1c Gia TP.HCM\\\"}\"', 'contact3', 1, 'Chi duong', '0000-00-00 00:00:00', '2018-10-24 09:08:20', 1),
(54, '{\"en\":\"<p> The Ambassador Hotel chain is designed and decorated in a unique, cozy, European-style three star hotel, conveniently located in the heart of the city for leisure, sightseeing and shopping. With long-term business investment strategy in Vietnam, our company will invest and expand more hotels to create convenience for customers. The initial goal will be the chain of 3-star Ambassador hotels in terms of quality, providing the best services for customers in Vietnam. <\\/ P>\\r\\n                <p> With the motto \\\"enthusiastic - hospitable\\\", we believe that visitors to Vietnam, whether for business, leisure or entertainment, will be impressed with the hospitality, professionalism We are passionate about our employees. <\\/ p>\\r\\n                <b> We care, always! <\\/ b>\",\"vi\":\"<p>Chu\\u1ed7i kh\\u00e1ch s\\u1ea1n Ambassador \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf v\\u00e0 trang tr\\u00ed \\u0111\\u1ed9c \\u0111\\u00e1o, \\u1ea5m c\\u00fang theo phong c\\u00e1ch ch\\u00e2u \\u00c2u ti\\u00eau chu\\u1ea9n ba sao, n\\u1eb1m ngay v\\u1ecb tr\\u00ed trung t\\u00e2m thu\\u1eadn ti\\u1ec7n cho vi\\u1ec7c vui ch\\u01a1i - tham quan v\\u00e0 mua s\\u1eafm. V\\u1edbi chi\\u1ebfn l\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 kinh doanh d\\u00e0i h\\u1ea1n t\\u1ea1i Vi\\u1ec7t Nam, c\\u00f4ng ty ch\\u00fang t\\u00f4i s\\u1ebd \\u0111\\u1ea7u t\\u01b0 v\\u00e0 m\\u1edf r\\u1ed9ng th\\u00eam kh\\u00e1ch s\\u1ea1n \\u0111\\u1ec3 t\\u1ea1o s\\u1ef1 ti\\u1ec7n l\\u1ee3i cho c\\u00e1c Kh\\u00e1ch h\\u00e0ng. M\\u1ee5c ti\\u00eau b\\u01b0\\u1edbc \\u0111\\u1ea7u s\\u1ebd l\\u00e0 chu\\u1ed7i nh\\u1eefng kh\\u00e1ch s\\u1ea1n Ambassador 3 sao h\\u00e0ng \\u0111\\u1ea7u v\\u1ec1 ch\\u1ea5t l\\u01b0\\u1ee3ng, cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 t\\u1ed1t nh\\u1ea5t cho Kh\\u00e1ch h\\u00e0ng t\\u1ea1i Vi\\u1ec7t Nam.<\\/p>\\r\\n                <p>V\\u1edbi ph\\u01b0\\u01a1ng ch\\u00e2m \\u201cNhi\\u1ec7t t\\u00ecnh - Hi\\u1ebfu kh\\u00e1ch\\u201d, ch\\u00fang t\\u00f4i tin r\\u1eb1ng du kh\\u00e1ch \\u0111\\u1ebfn Vi\\u1ec7t Nam d\\u00f9 v\\u1edbi m\\u1ee5c \\u0111\\u00edch kinh doanh, ngh\\u1ec9 d\\u01b0\\u1ee1ng hay gi\\u1ea3i tr\\u00ed c\\u0169ng \\u0111\\u1ec1u s\\u1ebd \\u1ea5n t\\u01b0\\u1ee3ng v\\u1edbi s\\u1ef1 m\\u1ebfn kh\\u00e1ch, phong c\\u00e1ch ph\\u1ee5c v\\u1ee5 chuy\\u00ean nghi\\u1ec7p, \\u0111\\u1ea7y nhi\\u1ec7t huy\\u1ebft c\\u1ea3u t\\u1eadp th\\u1ec3 nh\\u00e2n vi\\u00ean c\\u1ee7a ch\\u00fang t\\u00f4i.<\\/p>\\r\\n                <b>We care, always! <\\/b>\"}', 'aboutus', 0, 'Giới thiệu chung', '0000-00-00 00:00:00', '2018-11-14 22:03:24', 1);
INSERT INTO `tours` (`id`, `name`, `slug`, `hotel_id`, `cover_photo`, `max_2_adult`, `max_4_adult`, `max_6_adult`, `max_9_adult`, `above_10_adult`, `show_to_booking`, `short_description`, `full_description`, `status`, `added_date`, `updated_date`, `updated_by`) VALUES
(1, '{\"en\":\"CU CHI TUNNELS - HALF DAY\",\"vi\":\"\\u0110\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi (N\\u1eeda ng\\u00e0y) \"}', 'cu-chi-tunnels-half-day', 1, '2016-11-18-14-11-59296961245-website-tours-_0000s_0002_cu-chi-tunnels-jpg', 60000, 2000000, 70000, 0, 20000, 1, '{\"en\":\"<p>Visitors to Vietnam should not miss a visit to this underground village with our intricate network of over 200 km of tunnels at Ben Dinh, 50 km from Ho Chi Minh City.<\\/p>\\r\\n\",\"vi\":\"<p>Kh&aacute;m ph&aacute; nh\\u1eefng b&iacute; m\\u1eadt l\\u1ecbch s\\u1eed \\u1ea9n d\\u01b0\\u1edbi khu \\u0111\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi, m\\u1ed9t m&ecirc; cung ng\\u1ea7m kh\\u1ed5ng l\\u1ed3 do ng\\u01b0\\u1eddi Vi\\u1ec7t Nam x&acirc;y d\\u1ef1ng v&agrave; s\\u1eed d\\u1ee5ng \\u0111\\u1ec3 l\\u1ea9n tr\\u1ed1n qu&acirc;n Ph&aacute;p v&agrave; Hoa K\\u1ef3.<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Cu Chi used to be a bitter battleground for many years during the Vietnam War. Visitors to our country should not miss a visit to this underground village with our intricate network of over 200 km of tunnels at Ben Dinh, 50 km from Ho Chi Minh City. Don&#39;t miss the experience of a short, exciting trip through this labyrinth of interlaced tunnels. In addition, green paddy fields along the road to Cu Chi, and see local peasants at work and buffaloes led by children&hellip;These are really pleasant sights and will offer you some insights into Vietnamese agriculture as well (Extra: you can use the gun here!).<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>START EVERYDAY<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Available at the hotel lobby<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Pick up time: 8:00 &ndash; 8:30 AM or 13:00 - 13:30 PM&nbsp;<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Drop off time: 13:30 - 14:00 PM or 18:30 - 19:00PM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Group size: Max 9 guests\\/group<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>BRIEF ITINERARY<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Pick up at your hotel and drive to Cu Chi (60km &ndash; 1,5 hours)<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Upon arrival, watch a documentary film<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Learn more about the handmade weapon and traps<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Discover an underground city<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Taste streamed tapioca and hot tea<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Visit rice paper workshop<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Try shooting AK47, M16, M60, M30<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>PRICE<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<table border=\\\"1\\\" cellpadding=\\\"10\\\" cellspacing=\\\"10\\\" style=\\\"width:840px\\\">\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>AGE POLICY<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>ADULT<br \\/>\\r\\n\\t\\t\\t(From 12 up )&nbsp;<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>CHILD<br \\/>\\r\\n\\t\\t\\t(From 6-11)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>PRICE IN &nbsp;VND\\/PERSON<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">540.000<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">400.000<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">F.O.C<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">F.O.C<\\/span><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t<\\/tbody>\\r\\n<\\/table>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><em>Inclusions: Travel insurance, AC mini-van, English speaking guide, Entrance fees, Mineral water (1 bottle\\/tour), Wet tissue.<\\/em><\\/span><\\/p>\\r\\n\",\"vi\":\"<p>Kh&aacute;m ph&aacute; nh\\u1eefng b&iacute; m\\u1eadt l\\u1ecbch s\\u1eed \\u1ea9n d\\u01b0\\u1edbi khu \\u0111\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi, m\\u1ed9t m&ecirc; cung ng\\u1ea7m kh\\u1ed5ng l\\u1ed3 do ng\\u01b0\\u1eddi Vi\\u1ec7t Nam x&acirc;y d\\u1ef1ng v&agrave; s\\u1eed d\\u1ee5ng \\u0111\\u1ec3 l\\u1ea9n tr\\u1ed1n qu&acirc;n Ph&aacute;p v&agrave; Hoa K\\u1ef3.<\\/p>\\r\\n\\r\\n<p>Sau khi \\u0111i qua nh\\u1eefng khu v\\u01b0\\u1eddn v&agrave; \\u0111\\u1ed3ng ru\\u1ed9ng th\\u01a1 m\\u1ed9ng m\\u1ea5t kho\\u1ea3ng 1,5 gi\\u1edd, b\\u1ea1n s\\u1ebd \\u0111\\u1ebfn \\u0111\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi v&agrave; xem m\\u1ed9t phim t&agrave;i li\\u1ec7u ng\\u1eafn v\\u1ec1 h\\u1ec7 th\\u1ed1ng \\u0111\\u1ecba \\u0111\\u1ea1o n&agrave;y. Sau \\u0111&oacute; b\\u1ea1n c&oacute; th\\u1ec3 t\\u1ef1 do tr\\u1ea3i nghi\\u1ec7m \\u0111\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi, kh&aacute;m ph&aacute; nh\\u1eefng \\u0111\\u01b0\\u1eddng ng\\u1ea7m h\\u1eb9p, boong-ke, v&agrave; c&aacute;c khu \\u1ea9n n&aacute;u b&iacute; m\\u1eadt. \\u0110&acirc;y c\\u0169ng l&agrave; c\\u01a1 h\\u1ed9i \\u0111\\u1ec3 b\\u1ea1n t&i