(6, '{\"en\":\"CLASSIC MEKONG DELTA (FULL DAY)\",\"vi\":\"\\u0110\\u1ed3ng b\\u1eb1ng S\\u00f4ng C\\u1eedu Long c\\u1ed5 k\\u00ednh (C\\u1ea3 ng\\u00e0y)\"}', 'classic-mekong-delta-full-day', 1, '2016-11-18-14-09-31313905189-website-tours-_0000s_0005_mekong-delta-insight-jpg', 0, 0, 0, 0, 0, 1, '{\"en\":\"<p>MY THO - BEN TRE (4 ISLANDS)<\\/p>\\r\\n\\r\\n<p>My Tho is dotted width serene Buddhist pagodas and surrounded by vast paddy fields and dense fruit gardens. Highlight of a day trip to Ben Tre is to board a traditional boat for a fantastic view along a vast network of canals and channels.<\\/p>\\r\\n\",\"vi\":\"<p>H&atilde;y ng\\u1eafm nh&igrave;n c\\u01b0 d&acirc;n \\u0111\\u1ecba ph\\u01b0\\u01a1ng trong cu\\u1ed9c s\\u1ed1ng \\u0111\\u1eddi th\\u01b0\\u1eddng, v&agrave; t&igrave;m hi\\u1ec3u c&aacute;ch h\\u1ecd l&agrave;m ra nh\\u1eefng m&oacute;n ngon nh\\u01b0 k\\u1eb9o d\\u1eeba v&agrave; b\\u1ecfng g\\u1ea1o. B\\u1ea1n s\\u1ebd c&oacute; c\\u01a1 h\\u1ed9i gh&eacute; th\\u0103m trang tr\\u1ea1i ong m\\u1eadt v&agrave; v\\u01b0\\u1eddn tr&aacute;i c&acirc;y, th\\u01b0\\u1edfng th\\u1ee9c tr&aacute;i c&acirc;y theo m&ugrave;a ngon l&agrave;nh trong l&uacute;c h&ograve;a m&igrave;nh theo \\u0111i\\u1ec7u nh\\u1ea1c truy\\u1ec1n th\\u1ed1ng Vi\\u1ec7t Nam.&nbsp;<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:justify\\\"><strong>START EVERYDAY<\\/strong><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Pick-up Time: 7:30 ~ 8:00 AM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Drop off Time: 16:00 ~ 16:30 PM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Group size : Max. 9 guests.<\\/span><\\/p>\\r\\n\\r\\n<p><strong><span style=\\\"font-size:14px\\\">BRIEF ITINERARY<\\/span><\\/strong><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Drive from Saigon through rice paddies and small villages to My Tho (70km ~ 1.5 hours)<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Visit Vinh Trang pagoda &ndash;one of the most beautiful and famous landmarks in the region<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Enjoy 3-hour boating &amp; freely walking trip at Mekong Delta<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Explore The Mekong River small canals by rowing sampan<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Visit a beautiful island with many tropical orchards<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Discover how to make coconut candy and try some<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Ride a horse-cart throughout the village<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Taste local fresh fruits as well as honeybee tea<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Have lunch at a garden restaurant on river bank with countryside specialties<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Drive back to Saigon and drop at your hotel<\\/span><\\/p>\\r\\n\\r\\n<p><strong><span style=\\\"font-size:14px\\\">PRICE<\\/span><\\/strong><\\/p>\\r\\n\\r\\n<table border=\\\"1\\\" cellpadding=\\\"10\\\" cellspacing=\\\"10\\\" style=\\\"width:840px\\\">\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>AGE POLICY<\\/strong><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>ADULT<br \\/>\\r\\n\\t\\t\\t(From 12 up)<\\/strong><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>CHILD<br \\/>\\r\\n\\t\\t\\t(From 5-11)<\\/strong><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>PRICE IN VND\\/PERSON<\\/strong><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center