(7, '{\"en\":\"MEKONG VINH LONG \\u2013 CAI BE (FULL DAY)\",\"vi\":\"Mekong V\\u0129nh Long \\u2013 C\\u00e1i B\\u00e8 (C\\u1ea3 ng\\u00e0y)\"}', 'mekong-vinh-long-–-cai-be-full-day', 0, '2016-11-18-14-05-44986384809-website-tours-_0000s_0005_mekong-delta-insight-(full-day)-jpg', 0, 0, 0, 0, 0, 0, '{\"en\":\"<p>This day trip from Ho Chi Minh City to Cai Be takes you to visit fruit orchards, a candy workshop and Cai Be Floating Market.<\\/p>\\r\\n\",\"vi\":\"<p>H&atilde;y c\\u1ea3m nghi\\u1ec7m c\\u1ea3nh \\u0111\\u1eb9p, l\\u1eafng nghe &acirc;m thanh v&agrave; th\\u01b0\\u1edfng th\\u1ee9c h\\u01b0\\u01a1ng v\\u1ecb c\\u1ee7a \\u0111\\u1eddi s\\u1ed1ng \\u0111\\u1ecba ph\\u01b0\\u01a1ng t\\u1ea1i \\u0110\\u1ed3ng b\\u1eb1ng S&ocirc;ng C\\u1eedu Long v\\u1edbi chuy\\u1ebfn h&agrave;nh tr&igrave;nh m\\u1ed9t ng&agrave;y t\\u1eeb S&agrave;i G&ograve;n \\u0111\\u1ebfn th\\u1ecb tr\\u1ea5n nh\\u1ecf duy&ecirc;n d&aacute;ng C&aacute;i B&egrave;.&nbsp;<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Enjoy local life in Mekong Delta with a boat ride. This day trip from Ho Chi Minh City to Cai Be takes you to visit fruit orchards, a candy workshop and Cai Be Floating Market before a cruise through the maze of canals to Tan Phong Island for cooking class. You&rsquo;ll learn the art of Vietnamese cuisine and interact with local people. Enjoy lunch with fresh tropical fruits.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">After lunch, bicycle around the village and take a short row on local sampan, then get back on motor boat to Cai Be and transfer to Ho Chi Minh City. End of service.<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>START EVERYDAY<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Pick-up Time: 7:00 ~ 7:30 AM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Drop off Time: About 17:00 PM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Group size : Max. 9 guests.<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>BRIEF ITINERARY<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Cai Be floating market<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Learn how to make coconut candy, pop-rice, rice paper<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Visit fruit orchard, listen to traditional Vietnamese music called &ldquo;don ca tai tu&rdquo;<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Shopping at local market, join in cooking class, discover Vietnamese cuisine<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Take a bicycle to ride along the village path<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Visit a local pagoda, ancient house<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Rowing sampan along busy canals<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>PRICE<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<table border=\\\"1\\\" cellpadding=\\\"10\\\" cellspacing=\\\"10\\\" style=\\\"width:840px\\\">\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>AGE POLICY<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>ADULT<br \\/>\\r\\n\\t\\t\\t(From 12 up)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>CHILD<br \\/>\\r\\n\\t\\t\\t(From 5-11)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>KID<br \\/>\\r\\n\\t\\t\\t(Under 5)<\\/strong><\\/span><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\"><strong>PRICE IN VND\\/PERSON<\\/strong><\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">1.090.000<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">790.000<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">F.O.C<\\/span><\\/td>\\r\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><span style=\\\"font-size:14px\\\">F.O.C<\\/span><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t<\\/tbody>\\r\\n<\\/table>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><em>Inclusion: AC mini-van, English speaking guide, mineral water (1 bottle\\/ tour), boat trips, Bicycle, Fresh fruits, Cooking class, Entrance fees and Lunch.<\\/em><\\/span><\\/p>\\r\\n\",\"vi\":\"<p><span style=\\\"font-size:14px\\\">H&atilde;y c\\u1ea3m nghi\\u1ec7m c\\u1ea3nh \\u0111\\u1eb9p, l\\u1eafng nghe &acirc;m thanh v&agrave; th\\u01b0\\u1edfng th\\u1ee9c h\\u01b0\\u01a1ng v\\u1ecb c\\u1ee7a \\u0111\\u1eddi s\\u1ed1ng \\u0111\\u1ecba ph\\u01b0\\u01a1ng t\\u1ea1i \\u0110\\u1ed3ng b\\u1eb1ng S&ocirc;ng C\\u1eedu Long v\\u1edbi chuy\\u1ebfn h&agrave;nh tr&igrave;nh m\\u1ed9t ng&agrave;y t\\u1eeb S&agrave;i G&ograve;n \\u0111\\u1ebfn th\\u1ecb tr\\u1ea5n nh\\u1ecf duy&ecirc;n d&aacute;ng C&aacute;i B&egrave;. B\\u1ea1n s\\u1ebd \\u0111\\u01b0\\u1ee3c gh&eacute; th\\u0103m v\\u01b0\\u1eddn tr&aacute;i c&acirc;y, x\\u01b0\\u1edfng l&agrave;m k\\u1eb9o d\\u1eeba v&agrave; Ch\\u1ee3 n\\u1ed5i C&aacute;i B&egrave; tr\\u01b0\\u1edbc khi r\\u1ebd n\\u01b0\\u1edbc qua h\\u1ec7 th\\u1ed1ng k&ecirc;nh ng&ograve;i \\u1edf c\\u1ed3n T&acirc;n Phong \\u0111\\u1ec3 \\u0111\\u1ebfn tham gia m\\u1ed9t l\\u1edbp h\\u1ecdc n\\u1ea5u \\u0103n. B\\u1ea1n s\\u1ebd h\\u1ecdc v\\u1ec1 ngh\\u1ec7 thu\\u1eadt \\u1ea9m th\\u1ef1c Vi\\u1ec7t Nam v&agrave; c&oacute; c