(8, '{\"en\":\"CU CHI TUNNELS ( 1 WAY BUS, 1 WAY BOAT)\",\"vi\":\"Kh\\u00e1m ph\\u00e1 \\u0111\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi b\\u1eb1ng xe bu\\u00fdt v\\u00e0 thuy\\u1ec1n (n\\u1eeda ng\\u00e0y)\"}', 'cu-chi-tunnels-1-way-bus-1-way-boat', 0, '2016-11-18-14-13-09907871266-website-tours-_0000s_0006_cu-chi-tunnels-(1-way-bus-1-way-boat)-jpg', 0, 0, 0, 0, 0, 0, '{\"en\":\"<p>Just 70 km (40 miles) northwest of Sai Gon, the Cu Chi area resides at the end of the Ho Chi Minh Trail and served as the base from where Vietnamese guerrilla soldier attacked Sai Gon.<\\/p>\\r\\n\",\"vi\":\"<p>C&aacute;ch S&agrave;i G&ograve;n 70km v\\u1ec1 h\\u01b0\\u1edbng t&acirc;y b\\u1eafc, \\u0110\\u1ecba \\u0111\\u1ea1o C\\u1ee7 Chi s\\u1ebd mang \\u0111\\u1ebfn cho b\\u1ea1n nh\\u1eefng hi\\u1ec3u bi\\u1ebft \\u1ea5n t\\u01b0\\u1ee3ng v\\u1ec1 \\u0111\\u1eddi s\\u1ed1ng c\\u1ee7a b\\u1ed9 \\u0111\\u1ed9i Vi\\u1ec7t Nam, nh\\u1eefng ng\\u01b0\\u1eddi \\u0111&atilde; s\\u1eed d\\u1ee5ng h\\u1ec7 th\\u1ed1ng \\u0111\\u01b0\\u1eddng ng\\u1ea7m n&agrave;y trong cu\\u1ed9c chi\\u1ebfn tranh du k&iacute;ch ch\\u1ed1ng qu&acirc;n \\u0111\\u1ed9i Ph&aacute;p v&agrave; M\\u1ef9.<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Just 70 km (40 miles) northwest of Sai Gon, the Cu Chi area resides at the end of the Ho Chi Minh Trail and served as the base from where Vietnamese guerrilla soldier attacked Sai Gon. The fighters of Cu Chi took the war underground by developing a network of tunnels that stretched as far as Cambodia, which included : meeting rooms,kitchens and ventilation system. these tunnels served as an effective network for engaging in guerrilla warfare against U.S troops.<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>START EVERYDAY<\\/strong><\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Pick up time: 8:00 ~ 8:30 AM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Drop o