(10, '{\"en\":\"CAN GIO - VAM SAT MANGROVE (FULL DAY)\",\"vi\":\"R\\u1eebng ng\\u1eadp m\\u1eb7n C\\u1ea7n Gi\\u1edd - V\\u00e0m S\\u00e1t (C\\u1ea3 ng\\u00e0y)\"}', 'can-gio-vam-sat-mangrove-full-day', 0, '2016-11-18-14-04-16434441521-website-tours-_0000s_0000_can-gio---vam-sat-mangrove-(full-day)-jpg', 0, 0, 0, 0, 0, 1, '{\"en\":\"<p>A short trek will take you to the nearby bird reserve during the nesting season (*) where a watchtower will allow you to observe thousands birds flying around.<\\/p>\\r\\n\",\"vi\":\"<p>Chuy\\u1ebfn th&aacute;m hi\\u1ec3m \\u0111\\u1ec3 kh&aacute;m ph&aacute; th\\u1ebf gi\\u1edbi hoang d&atilde; d&agrave;nh cho ng\\u01b0\\u1eddi y&ecirc;u thi&ecirc;n nhi&ecirc;n \\u1edf m\\u1ecdi l\\u1ee9a tu\\u1ed5i.<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Depart Saigon and head straight to our port in Can Gio - Vam Sat. Take the canoe trip along the immense river to go to the bat area. Here you&#39;ll board a rowing boat to explore the natural landscape and its inhabitants such as the large fruit bats. A short trek will take you to the nearby bird reserve during the nesting season (*) where a watchtower will allow you to observe thousands birds flying around. Have lunch at a local e-co restaurant.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">After lunch, keep walking to the natural crocodile lake. While out of the lake, occasionally, you may see wild monkeys jumping out from the forest. Heading back to Saigon.<\\/span><\\/p>\\r\\n\\r\\n<p><strong><span style=\\\"font-size:14px\\\">START EVERYDAY<\\/span><\\/strong><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Pick up time: 8:00 ~ 8:30 AM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Drop off time: About 17:00 PM<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Group size: Max. 11 guests<\\/span><\\/p>\\r\\n\\r\\n<p><strong><span sty