(12, '{\"en\":\"A O SHOW (\\u00c0 \\u1ed0 SHOW)\",\"vi\":\"A O SHOW (\\u00c0 \\u1ed0 SHOW)\"}', 'a-o-show-a-o-show', 0, '2016-12-20-09-35-54277837276-website-tours-_0000s_0005_aoshow-jpg', 0, 0, 0, 0, 0, 1, '{\"en\":\"<p>A O Show fabricates and depicts in artistic ways the ambiance and the lifelike activities of Vietnam in the countryside and the country&rsquo;s urbanization.<\\/p>\\r\\n\",\"vi\":\"<p>H&atilde;y t\\u1eadn m\\u1eaft tr\\u1ea3i nghi\\u1ec7m ngh\\u1ec7 thu\\u1eadt s&acirc;n kh\\u1ea5u \\u0111\\u1ec9nh cao c\\u1ee7a Vi\\u1ec7t Nam t\\u1ea1i m\\u1ed9t trong nh\\u1eefng \\u0111\\u1ecba \\u0111i\\u1ec3m l\\u1ecbch s\\u1eed n\\u1ed5i ti\\u1ebfng nh\\u1ea5t c\\u1ee7a S&agrave;i G&ograve;n.&nbsp;<\\/p>\\r\\n\"}', '{\"en\":\"<p style=\\\"text-align:center\\\"><iframe frameborder=\\\"0\\\" height=\\\"315\\\" src=\\\"https:\\/\\/www.youtube.com\\/embed\\/SP3q-pjY4g4\\\" width=\\\"840\\\"><\\/iframe><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">A O Show fabricates and depicts in artistic ways the ambiance and the lifelike activities of Vietnam in the countryside and the country&rsquo;s urbanization. Many props and cultural images from typical Vietnamese life will feel familiar to audiences who may have encountered the traditional wet markets, fishing baskets and the bamboo bridges elsewhere in Vietnam. The show integrates Acrobatics and Contemporary dance to entertain viewers both young and old.&nbsp;<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">A blend of Bamboo Cirque, Acrobatic Acts and Contemporary Dance.Music is composed exclusively for the show by the use of 17 Vietnamese musical instruments.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">A O Show is performed at Opera House. In 2012, the iconic architecture of the city with 117 years old Opera House was honored a National Relic, it has become a favorite stop of tourists but not many of them have had the opportunity to see its beauty from the inside.<\\/span><\\/p>\\r\\n\\r\\n<p><strong>PRICE<\\/strong><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">- Price: VND 630.000<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Show time: 18:00 &amp; 20:00<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Duration: Approximately 60 minutes.<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">-&nbsp;Location: Opera House.<\\/span><\\/p>\\r\\n\",\"vi\":\"<p style=\\\"text-align:center\\\"><iframe frameborder=\\\"0\\\" height=\\\"315\\\" src=\\\"https:\\/\\/www.youtube.com\\/embed\\/SP3q-pjY4g4\\\" width=\\\"840\\\"><\\/iframe><\\/p>\\r\\n\\r\\n<p>H&atilde;y t\\u1eadn m\\u1eaft tr\\u1ea3i nghi\\u1ec7m ngh\\u1ec7 thu\\u1eadt s&acirc;n kh\\u1ea5u \\u0111\\u1ec9nh cao c\\u1ee7a Vi\\u1ec7t Nam t\\u1ea1i m\\u1ed9t trong nh\\u1eefng \\u0111\\u1ecba \\u0111i\\u1ec3m l\\u1ecbch s\\u1eed n\\u1ed5i ti\\u1ebfng nh\\u1ea5t c\\u1ee7a S&agrave;i G&ograve;n. V\\u1edf m&uacute;a &Agrave; \\u1ed0 Show m&ocirc; t\\u1ea3 \\u0111\\u1eddi s\\u1ed1ng n&ocirc;ng th&ocirc;n Vi\\u1ec7t Nam \\u0111\\u1ed1i ngh\\u1ecbch v\\u1edbi nh\\u1eefng chuy\\u1ec3n d\\u1ecbch \\u0111&ocirc; th\\u1ecb h&oacute;a c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc qua nh\\u1eefng m&agrave;n bi\\u1ec3u di\\u1ec5n xi\\u1ebfc ngo\\u1ea1n m\\u1ee5c v\\u1edbi tre, nh\\u1eefng \\u0111\\u1ed9ng t&aacute;c nh&agrave;o l\\u1ed9n, ngh\\u1ec7 thu\\u1eadt m&uacute;a \\u0111\\u01b0\\u01a1ng \\u0111\\u1ea1i v&agrave; ngh\\u1ec7 thu\\u1eadt th\\u1ecb gi&aacute;c. &Acirc;m nh\\u1ea1c t\\u1eeb 17 lo\\u1ea1i nh\\u1ea1c c\\u1ee5 Vi\\u1ec7t Nam v\\u1edbi c&aacute;c ca kh&uacute;c truy\\u1ec1n th\\u1ed1ng truy\\u1ec1n t\\u1ea3i nh\\u1eefng n&eacute;t v\\u0103n h&oacute;a \\u0111\\u1ed9c \\u0111&aacute;o v&agrave; \\u0111\\u1eb7c tr\\u01b0ng nh\\u1ea5t c\\u1ee7a Vi\\u1ec7t Nam, m&ecirc; ho\\u1eb7c kh&aacute;n gi\\u1ea3 b\\u1eb1ng b\\u1ed1i c\\u1e